import React from "react";
import '../App';
import { useAppContext } from "./context/appContext";
import { Link } from "react-router-dom";

const Home = () => {
    const { translatedIntro, translatedAbout, setLanguage } = useAppContext();

    const handleLanguageChange = (event) => {
        setLanguage(event.target.value);
    };

    const supportedLanguages = [
        { code: 'en', label: 'English' },
        { code: 'es', label: 'Spanish' },
        { code: 'fr', label: 'French' },
        { code: 'de', label: 'German' },
        { code: 'it', label: 'Italian' },
        { code: 'nl', label: 'Dutch' },
        { code: 'pl', label: 'Polish' },
        { code: 'pt', label: 'Portuguese' },
        { code: 'ru', label: 'Russian' },
        { code: 'zh', label: 'Chinese' },
        { code: 'ja', label: 'Japanese' },
        { code: 'tr', label: 'Turkish' },
    ];

    return (
        <div className="home-container">
            <div className="header">
                <section>
                    <header>
                        <h1>Financial Literacy</h1>
                        <h2>"An investment in knowledge pays the best interest."</h2>
                    </header>
                </section>
            </div>

            <div className="translate-button">
                <select onChange={handleLanguageChange}>
                    {supportedLanguages.map(lang => (
                        <option key={lang.code} value={lang.code}>
                            {lang.label}
                        </option>
                    ))}
                </select>
            </div>

            <div className="intro">
                <p>{translatedIntro || "Welcome to our Financial Literacy Resource Hub! Our mission is to provide detailed, easy-to-understand information on critical financial topics such as bank accounts, credit, taxes, budgeting, student loans and financing, insurance, and investing."}</p>
            </div>

            <div className="title resource"><h1>Resources</h1></div>
            <div className="topics-container">
                <Link to="/bank-accounts"> <div className="topic-item item1"><h1>Bank Accounts</h1></div></Link>
                <Link to="/credit"><div className="topic-item item2"><h1>Credit</h1></div></Link>
                <Link to="/taxes"><div className="topic-item item3"><h1>Taxes</h1></div></Link>
                <Link to="/budgeting"> <div className="topic-item item4"><h1>Budgeting</h1></div></Link>
                <Link to="/student-loans"> <div className="topic-item item5"><h1>Student Loans</h1></div></Link>
                <Link to="/insurance"><div className="topic-item item6"><h1>Insurance</h1></div></Link>
                <Link to="/investing"><div className="topic-item item7"><h1>Investing</h1></div></Link>
            </div>

            <div className="about-section">
                <div className="title"><h1 className="title">Inspiration</h1></div>
                <div>
                    <p>{translatedAbout || "This project was also motivated by the clear financial literacy gap seen in different communities. Research has shown that Black and Hispanic individuals, both in their youth and adulthood, tend to have lower financial literacy rates compared to their counterparts."}</p>
                </div>
            </div>
        </div>
    );
}

export default Home;
